INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, "みやこ", 3, 119901, "2024/12/31 11:59:59", 0, 14, 0, 119901, 0, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 450, 0, 1, "2024/12/22 12:00:00", 0, 2.17, "ミヤコ（クリスマス）", 302, 119901, 1, 1, 119901);
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 5, "しずる", 3, 120001, "2025/03/15 14:59:59", 0, 6, 0, 120001, 0, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 450, 0, 5, "2025/03/10 12:00:00", 0, 2.375, "シズル（ノワール）", 190, 120001, 1, 1, 120001);
